import React from 'react';
import './OvensView.css'
import OvenItem from './OvenItem';
import Loader from "../reusableComponents/Loader";


class OvensView extends React.Component{
    render() {
        return (
            //TODO :in case of having several oven items in need to use map
            <div>
                <OvenItem setupD={this.props.data.setupData} ovenD={this.props.data.ovenData}/>
            </div>
        )
    }
};

export default OvensView;
